import React from 'react'

const myFun1=()=>{
   console.log("Single Clicked on me ")

}
const myFun2=()=>{
     console.log("Double Cliked on me")

}
 

 const App=()=>{
     return (
         <div style={{backgroundColor}}>
             <button onClick={myFun1} onDoubleClick={myFun2}>Click me</button>
        </div>
     )

 }
export default App;
